package com.netease.nim.uikit.common;public class RobotInfo {    private String accid;    private String name;    private String icon;    private String link;    public String getAccid() {        return accid;    }    public void setAccid(String accid) {        this.accid = accid;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getIcon() {        return icon;    }    public void setIcon(String icon) {        this.icon = icon;    }    public String getLink() {        return link;    }    public void setLink(String link) {        this.link = link;    }}